import BullContainer from "./BullContainer";

const BullRow = (props) => {
    return(
        <div className="row">
           {props.upperStocks.map(data =>
               <BullContainer onClick={(e) => props.handleBoxClick(e.target.key)} key={data.id} data={data}/>
               )}    
        </div>
    )
}

export default BullRow;
